import{_ as a,o as e,c as t,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 56-355.2 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-355.2.md","filePath":"vacode/56-355.2.md"}'),r={name:"vacode/56-355.2.md"},n=i('<h1 id="§-56-355-2-definitions" tabindex="-1">§ 56-355.2 Definitions. <a class="header-anchor" href="#§-56-355-2-definitions" aria-label="Permalink to &quot;§ 56-355.2 Definitions.&quot;">​</a></h1><p>&quot;Public road authority&quot; as used in this chapter means any appropriate governing body which has responsibility for the construction and maintenance of public highways.</p><p>&quot;Overpass&quot; as used in this chapter means a grade separation structure in which the public highway passes above and across the railroad.</p><p>&quot;Underpass&quot; as used in this chapter means the railroad passes above and across the public highway.</p><p>&quot;Highway&quot; as used in this chapter means any public highway, road, or street maintained by the Virginia Department of Transportation or for which maintenance payments are made pursuant to §§ <a href="http://law.lis.virginia.gov/vacode/33.2-319/" target="_blank" rel="noreferrer">33.2-319</a> and <a href="http://law.lis.virginia.gov/vacode/33.2-366/" target="_blank" rel="noreferrer">33.2-366</a>.</p><p>1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0114" target="_blank" rel="noreferrer">114</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0157" target="_blank" rel="noreferrer">157</a>.</p>',6),o=[n];function s(h,c,p,d,l,_){return e(),t("div",null,o)}const g=a(r,[["render",s]]);export{f as __pageData,g as default};
